                            <h4 style={{color:process.env.REACT_APP_COLORS_DARKER}}>Links</h4>
                            <ul>
                                <NavBarItems/>
                            </ul>
                        </div>
                    </div>
                </div>
                <div className="footer-copyright">
                    <div className="container left-align black-text footer-cpc">
                        Â© {process.env.REACT_APP_CPYEAR} {process.env.REACT_APP_URL}
                        <div className="black-text text-lighten-4 right"><a style={{color}} href={configs.copyright.owner.link} >Powerd by {configs.copyright.owner.name}</a></div>
                    </div>
                </div>
            </footer>
        );
    }
}

export default Footer;
